function YearLineChart(props) {
  let numberOfYears = new Date().getFullYear() - 1994;
  const labels = Array.from({length: numberOfYears}, (_, i) => i + 1996)
  const data = {
    labels: labels,
    datasets: [
      {
        data: props.yearWiseData,
      //   fill: true,
      //   backgroundColor: "#D5D5D5",
        borderColor: "#F1F1F1"
      },

    ]
  };

  const options = {
      responsive: true,

      plugins: {
          legend: {
            position: 'top',
          },
          // title: {
          //   display: true,
          //   text: 'Chart.js Line Chart',
          //   color: 'red',
          // },
          labels: {
              color: 'red',
              size: '40px',
              textColor: 'red',
          }
        },
  }

  return (
    <div className="App">
      <Line data={data} options={options} updateMode={'hide'}/>
    </div>
  );
}

export default YearLineChart;
